[{"location":"","page":"Home","title":"Home","text":"CurrentModule = OnlineSampleStatistics","category":"page"},{"location":"#OnlineSampleStatistics","page":"Home","title":"OnlineSampleStatistics","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for OnlineSampleStatistics.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [OnlineSampleStatistics]","category":"page"},{"location":"#OnlineSampleStatistics.UnivariateStatistic-Union{Tuple{I}, Tuple{T}, Tuple{I, Vector{T}}} where {T, I}","page":"Home","title":"OnlineSampleStatistics.UnivariateStatistic","text":"UnivariateStatistic(x::T,K::Int) where {T<:Number}\n\nConstructs a UnivariateStatistic object of type T with K moments from a single sample x.  The first moment (the mean) is then x and the remaining moments are zeros of type T.  The weight counts the number of sample set to 1.\n\nArguments\n\nK::Int: The number of moments to store.\nx::T: The first sample.\n\n\n\nUnivariateStatistic(K::Int, T::Type)\n\nConstructs an empty UnivariateStatistic object of type T with K moments.\n\nArguments\n\nK::Int: The number of moments to store.\nT::Type: The type of the elements in the moments.\n\n\n\nUnivariateStatistic(K::Int)\n\nConstructs an empty UnivariateStatistic object of type Float64 with K moments.\n\n\n\nUnivariateStatistic(::Type{T}, x, K::Int) where {T}\n\nConstructs a UnivariateStatistic object  of type T with a single sample x.\n\nArguments\n\nT::Type: The type to which the elements of x will be converted.\nK::Int: The number of moments to store.\nx: The sample to be converted to type T and passed to the constructor.\n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.UnivariateStatistic-Union{Tuple{T}, Tuple{AbstractArray{T}, Int64}} where T<:Number","page":"Home","title":"OnlineSampleStatistics.UnivariateStatistic","text":"UnivariateStatistic(K::Int, x::AbstractArray{T}) where {T<:Number}\n\nConstructs a UnivariateStatistic object storing the first K moments  from the vector of samples x.\n\nArguments\n\nK::Int: The number of moments \nx::AbstractArray{T}: array of samples where T is a subtype of Number.\n\n\n\n\n\n","category":"method"},{"location":"#Base.merge!-Union{Tuple{I}, Tuple{K}, Tuple{T2}, Tuple{T1}, Tuple{UnivariateStatistic{T1, 1, I}, UnivariateStatistic{T2, K, I}}} where {T1, T2, K, I}","page":"Home","title":"Base.merge!","text":"merge!(A::UnivariateStatistic, B::UnivariateStatistic)\n\nMerges (inplace) the statistics from B into A in-place. The weights and raw moments of A are updated to reflect the combined statistics of both A and B.\n\nArguments\n\nA::UnivariateStatistic: The destination statistic to be updated.\nB::UnivariateStatistic: The source statistic to merge into A.\n\nExample\n\nA = UnivariateStatistic(2, [1.0, 0.5])\nB = UnivariateStatistic(2, [2.0, 1.5])\nmerge!(A, B)\n\n\n\n\n\n","category":"method"},{"location":"#Base.merge-Union{Tuple{K}, Tuple{T2}, Tuple{T1}, Tuple{UnivariateStatistic{T1, 1}, UnivariateStatistic{T2, K}}} where {T1, T2, K}","page":"Home","title":"Base.merge","text":"merge(A::UnivariateStatistic, B::UnivariateStatistic)\n\nMerges the statistics from B into A to a new object. The type of the new object will be promoted.\n\nArguments\n\nA::UnivariateStatistic: The destination statistic to be updated.\nB::UnivariateStatistic: The source statistic to merge into A.\n\nExample\n\nA = UnivariateStatistic(2, [1.0, 0.5])\nB = UnivariateStatistic(2, [2.0, 1.5])\nmerge!(A, B)\n\n\n\n\n\n","category":"method"},{"location":"#Base.push!-Union{Tuple{T2}, Tuple{T}, Tuple{UnivariateStatistic{T}, AbstractArray{T2}}} where {T, T2}","page":"Home","title":"Base.push!","text":"Base.push!(A::UnivariateStatistic{T}, y::T2) where {T, T2}\n\nPushes a new samples y into the UnivariateStatistic A.\n\nArguments\n\nA::UnivariateStatistic{T}: The UnivariateStatistic object to which elements will be added. The type parameter T specifies the expected element type.\ny::T2: the sample or array of sample pushed to A. The type T2 must either match T or be promotable to T.\n\nThrows\n\nArgumentError: If the type of elements in y is not compatible with the type T of A.\n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.get_moments-Tuple{AbstractArray{<:UnivariateStatistic}, Int64}","page":"Home","title":"OnlineSampleStatistics.get_moments","text":"get_moments(x::AbstractArray{UnivariateStatistic}, k::Int)\n\nRetrieve the k-th moments from an array of UnivariateStatistic objects.  Returns an array where each element corresponds to the k-th moment of the respective UnivariateStatistic in x.\n\nArguments\n\nx::AbstractArray{UnivariateStatistic}: An array of UnivariateStatistic objects.\nk::Int: The order of the moment to retrieve.\n\nReturns\n\nAn array of k-th moments.\n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.get_moments-Union{Tuple{R}, Tuple{I}, Tuple{K}, Tuple{T}, Tuple{UnivariateStatistic{T, K, I, R}, Any}} where {T, K, I, R}","page":"Home","title":"OnlineSampleStatistics.get_moments","text":"get_moments(A::UnivariateStatistic{T,K,I}, k) -> Number\n\nCompute the k-th moment of a UnivariateStatistic A. \n\nArguments\n\nA::UnivariateStatistic{T,K,I}: The UnivariateStatistic object containing the samples statistic.\nk::Int: The order of the moment to compute.\n\nReturns\n\nThe k-th moment of the statistic. If it is empty, the function returns 0. \n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.get_rawmoments-Tuple{AbstractArray{<:UnivariateStatistic}, Int64}","page":"Home","title":"OnlineSampleStatistics.get_rawmoments","text":"get_rawmoments(x::AbstractArray{UnivariateStatistic}, k::Int)\n\nRetrieve the k-th raw moments from an array of UnivariateStatistic objects.  Returns an array where each element corresponds to the k-th raw moment of the respective UnivariateStatistic in x.\n\nArguments\n\nx::AbstractArray{UnivariateStatistic}: An array of UnivariateStatistic objects.\nk::Int: The order of the raw moment to retrieve.\n\nReturns\n\nAn array of k-th raw moments.\n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.get_rawmoments-Union{Tuple{AbstractArray{<:UnivariateStatistic{T, K}, N}}, Tuple{N}, Tuple{K}, Tuple{T}} where {T, K, N}","page":"Home","title":"OnlineSampleStatistics.get_rawmoments","text":"get_rawmoments(x::AbstractArray{<:UnivariateStatistic})\n\nRetrieve the raw moments from an array of UnivariateStatistic objects.  Returns an array where each element corresponds to the raw moments of the respective UnivariateStatistic in x.\n\nArguments\n\nx::AbstractArray{UnivariateStatistic}: An array of UnivariateStatistic objects.\n\nReturns\n\nAn array of raw moments.\n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.nonnegative-Tuple{Any}","page":"Home","title":"OnlineSampleStatistics.nonnegative","text":"nonnegative(x)\n\nCheck if the input x is nonnegative (greater than or equal to zero).\n\n\n\n\n\n","category":"method"},{"location":"#OnlineSampleStatistics.weights-Tuple{AbstractArray{<:UnivariateStatistic}}","page":"Home","title":"OnlineSampleStatistics.weights","text":"weights(x::AbstractArray{UnivariateStatistic})\n\nRetrieves the weights from an array of UnivariateStatistic objects.\n\nArguments\n\nx::AbstractArray{UnivariateStatistic}: An array of UnivariateStatistic objects.\n\nReturns\n\nAn array of weights.\n\n\n\n\n\n","category":"method"},{"location":"#Statistics.mean-Union{Tuple{UnivariateStatistic{T, K, I, R}}, Tuple{R}, Tuple{I}, Tuple{K}, Tuple{T}} where {T, K, I, R}","page":"Home","title":"Statistics.mean","text":"Statistics.mean(A::UnivariateStatistic{T,K,I}) where {T,K,I}\n\nCompute the mean of a UnivariateStatistic A \n\nSee also\n\nget_moments\n\n\n\n\n\n","category":"method"}]
